import React from "react";
import { Container } from "react-bootstrap";
//https://api.themoviedb.org/3/movie/popular?api_key=2ed27428d49a7dff95d8705d52d37dee&!language=en-US&page=1
let UpcomingAction = () => {
    return (
        <>
            <div>
                <Container>
                    <div className="wrapper">
                        <div className="title-wrapper">
                            <h1>Upcoming Movies</h1>
                        </div>

                        <div className="fillterAction">
                            
                        </div>
                    </div>
                </Container>
            </div>
        </>
    )
}

export default UpcomingAction
